import React from 'react';
import { Outlet, Link } from 'react-router-dom';

function About() {
  return (
    <div>
      <h1>About the App</h1>
      <ul>
        <li><Link to="team">Team</Link></li>
        <li><Link to="mission">Mission</Link></li>
      </ul>
      <Outlet />
    </div>
  );
}

export default About;
